void asn1Copy_lppa_MeasuredResultsValue (OSCTXT* pctxt, 
   const lppa_MeasuredResultsValue* pSrcValue, lppa_MeasuredResultsValue*
    pDstValue)
{
   if (pSrcValue == pDstValue)
      return;

   pDstValue->t = pSrcValue->t;
   switch (pSrcValue->t)
   {
      /* valueAngleOfArrival */
      case 1:
         pDstValue->u.valueAngleOfArrival = pSrcValue->u.valueAngleOfArrival;
         break;

      /* valueTimingAdvanceType1 */
      case 2:
         pDstValue->u.valueTimingAdvanceType1 = pSrcValue->u.valueTimingAdvanceType1;
         break;

      /* valueTimingAdvanceType2 */
      case 3:
         pDstValue->u.valueTimingAdvanceType2 = pSrcValue->u.valueTimingAdvanceType2;
         break;

      /* resultRSRP */
      case 4:
         pDstValue->u.resultRSRP = rtxMemAllocType (pctxt, lppa_ResultRSRP);

         if (0 == pDstValue->u.resultRSRP) {
            return;
         }

         asn1Init_lppa_ResultRSRP (pDstValue->u.resultRSRP);
         if (0 == pDstValue->u.resultRSRP) {
            return;
         }
         asn1Copy_lppa_ResultRSRP (pctxt, pSrcValue->u.resultRSRP, pDstValue->u.resultRSRP);
         break;

      /* resultRSRQ */
      case 5:
         pDstValue->u.resultRSRQ = rtxMemAllocType (pctxt, lppa_ResultRSRQ);

         if (0 == pDstValue->u.resultRSRQ) {
            return;
         }

         asn1Init_lppa_ResultRSRQ (pDstValue->u.resultRSRQ);
         if (0 == pDstValue->u.resultRSRQ) {
            return;
         }
         asn1Copy_lppa_ResultRSRQ (pctxt, pSrcValue->u.resultRSRQ, pDstValue->u.resultRSRQ);
         break;

      /* extElem1 */
      case 6:
         pDstValue->u.extElem1 = rtxMemAllocType (pctxt, ASN1OpenType);

         if (0 == pDstValue->u.extElem1) {
            return;
         }

         pDstValue->u.extElem1->numocts = 0;
         pDstValue->u.extElem1->data = 0;
         if (0 == pDstValue->u.extElem1) {
            return;
         }
         if (! rtCopyOpenType (pctxt, pSrcValue->u.extElem1, pDstValue->u.extElem1))
            return;
         break;

   }

   return;
}

